import React from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Preloader from './components/Preloader';
import Home from './pages/Home';

const App = () => {
  return (
    <Router>
      <Preloader />

      <Routes>
        <Route exact path="/" component={Home} />
      </Routes>


    </Router>
  )
}

export default App
